import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    payload = fetch("/api");
    payloadJSON = payload.json();
    setData(payloadJSON);
  })


  return(
    <div>
      <p>Hello</p>
    </div>
  )
}

export default App;
